export const getProducts = (data, timeout) => 
    new Promise((res) => 
        setTimeout(() => {
            res(data)
        }, timeout)
)


export const getItem = (item, delay) => 
    new Promise((res) => 
        setTimeout(() => {
            res(item)
    }, delay)
)
